@import url('https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@100;300;400;500;700;900&display=swap');

/* 기본 */
*{
    margin: 0; padding: 0;
    font-family: 'Noto Sans KR';
    color: #333;
}
@media all and (min-width: 1300px) and (max-width: 1320px){body{overflow-x: hidden;}}

li, ul, ol, a{list-style: none; color: inherit; text-decoration: none;}
h1, h2, h3, h4, h5, h6{font-weight: normal;}
.img{position: relative;}
a{display: block;}
img{display: block; width: 100%; height: auto;}


/* 양식 통일용 */
h1{
    font-size: 36px; font-weight: bold;
    text-align: center;
    margin-bottom: 15px;
    }
.tab_list{
    text-align: center;
    margin-bottom: 15px;
    }
.tab_list button{
    background: none;
    border: none;
    margin-right: 20px;

    &:last-child{margin-right: 0;}
    &:before{content: "#";}
}





/* scss mixin */
$mainC: #0E0057;

@mixin secWidth{
    width: 100%;
    min-width: 1300px;
    max-width: 1660px;
    margin: 0 auto;
    box-sizing: border-box; 
}
@mixin flexSB{display: flex; justify-content: space-between;}

section,.header_inner{@include secWidth;}
section{
    padding: 80px 0px;
    box-sizing: border-box;
}



/********** header **********/
.header{
    position: fixed;
    z-index: 9999;
    width: 100%;
    background: #fff;

    .header_inner{
        height: 100px;
        @include flexSB;
        align-items: center;
        color: #333;

        .logo{
            width: 140px;
            padding-left: 10px;
            padding-right: 120px;
            
            svg{
            fill: #333;
        }
    }

    .gnb{
        display: flex;

        >li{
            box-sizing: border-box;
            padding: 0 20px;
            &:nth-child(3){
                padding-right: 40px;
                border-right: 1px solid #aaa;
            }
            &:nth-child(4){
                padding-left: 40px;
            }
            >a{
                font:{
                    size: 20px;
                    weight: bold;
                }

                padding-bottom: 3px;
                border-bottom: 1px solid rgba(255,255,255,0);
                transition: .2s;
            }
            &:hover>a{
                border-bottom: 1px solid #333;}

            /* hovermenu */
            .gnb_hover{
                width: 100%;
                display: none;
                position: absolute;
                left: 0; top: 100px;
                background-color: #fff;

                >div{
                    @include secWidth;
                    @include flexSB;
                    padding-bottom: 30px;
                    box-sizing: border-box;

                    h4{font:{
                        size: 20px;
                        weight: bold;
                    }
                    margin-bottom: 20px;}

                    .new_bottom{
                        margin-top: 10px;
                        text-transform: uppercase;
                    }

                    >div{
                        width: 340px;
                        padding-left: 30px;
                        box-sizing: border-box;
                        line-height: 35px;
                        &:first-child{border-right: 1px solid #aaa;}
                    }

                    .gnb_center{
                        width: 980px;
                        @include flexSB;
                        padding-left: 0px;

                        >div{
                            width: 25%;
                            box-sizing: border-box;
                            padding-left: 30px;
                            border-right: 1px solid #aaa;
                        }
                    }/* gnb_center */
                    
                }/* /gnb_hover > div */
            
            .gnb_kids{
                justify-content: start;
                .gnb_center{width: 735px;
                >div{width: calc((100%)/3);
                &:last-child{border-right: none;}}
                }
            }/* .gnb_kids */

            .gnb_brand{
                a{
                    box-sizing: border-box;
                    padding: 30px 16px 50px;
                }

                p{
                    margin-top: 20px;
                    font-size: 20px;
                    text-align: center;
                }
            }/* gnb_brand */
            
            }/* gnb_hover */
        }/* li */
    }/* .gnb */

    .user_menu{
        width: 270px;
        @include flexSB;


        span{
            width: 60px; height: 60px;
            line-height: 60px;
            text-align: center;
            font-size: 40px;
            color: #333;
        }
    }


    } //.header_inner
}/* header */


//scroll effect
.header.top{
    background: none;
.header_inner{
    color: #fff;
    .logo svg{fill: #fff;}
    
    .gnb > li:nth-child(3){border-right: 1px solid #fff;}
    .user_menu span{
        width: 60px; height: 60px;
        line-height: 60px;
        text-align: center;
        font-size: 40px;
        color: #fff;
    }
}
}


/********** visual_main **********/
.visual_main{
    position: relative;
    overflow-x: hidden;

    .swiper-wrapper{
        width: 100vw; height: 100vh;
    }

    .swiper-button-prev{
        position: absolute;
        top: 50%; transform: translateY(-50%); left: 0;
        color: #fff;
        background-color: rgba(0,0,0,0.5);
        padding: 100px 40px;
    }
    .swiper-button-next{
        position: absolute;
        top: 50%; transform: translateY(-50%); right: 0;
        color: #fff;
        background-color: rgba(0,0,0,0.5);
        padding: 100px 30px;
    }

    .swiper-pagination{
        position: absolute;
        left: 5%; top: 100%;
        width: 90%; height: 5px;
        margin-top: -100px;

        border-radius: 5px;

        background-color: rgba(255,255,255,0.5);


        .swiper-pagination-progressbar-fill{
            border-radius: 5px;
            background-color: $mainC;
        }
    }


    img{
        width: 100vw; height: 100vh;
        object-fit: cover;
    }




} //visual_main


/********** ranking **********/
.ranking{
    background-color: #eee;

    .list{
        width: 480px;
        height: 480px;
        background-color: #000;
    }

    .rank_tab{
        display: flex;
        justify-content: start;
        align-items: center;
        
    }

    .empty{
        width: 480px;
        height: 480px;
        background-color: #000;
    }

    .rank_slider{
        width: calc(100% - 480px);


        .swiper-slide{
            width: 60%;
            height: 200px;
            background-color: #666;
            transition: .3s;

            &.swiper-slide-next,
            &.swiper-slide-next+.swiper-slide{
                position: relative;
                z-index: -1;
                margin-top: 80px;
                margin-right: 3px;
                width: 40%;
                height: 540px;
                background-color: #aaa;
            }            
            &.swiper-slide-next{
                margin-left: -10%;
            }
        }




    }
}


/********** mid_banner **********/
.mid_banner{

    .img{
        width: 100%; height: 500px;
        background:{
            image: url(./img/sus_ban01.jpg);
            position: center ;
            size: cover;
            repeat: no-repeat;
            attachment: fixed;
        };
    }
}
